import { createStore, combineReducers } from 'redux';
import reducers from '../reducers';

const store = createStore(reducer = combineReducers({ reducers }), window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());

export default store;
